import Admin from './Admin/admin'
import Addcat from './Admin/addcat';
import Viewcat from './Admin/viewcat';
import Addtable from './Admin/addtable';
import Viewtable from './Admin/viewtable';

import Addcompany from './company/addcompany';
import Viewcompany from './company/viewcompany';

import Addproduct from './product/addproduct';
import Viewproduct from './product/viewproduct';

import Addpage from './page/addpage';
import Viewpage from './page/viewpage';

import Addcatagory from './collection and category/addcatagory';

import {BrowserRouter,Routes,Route} from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
    <Routes>
        <Route path='/' element={<Admin/>}/>

        <Route path="/add-company" element={<Addcompany/>} />
        <Route path="/view-company" element={<Viewcompany/>} />

        <Route path="/add-product" element={<Addproduct/>} />
        <Route path="/view-product" element={<Viewproduct/>} />

        <Route path="/add-page" element={<Addpage/>} />
        <Route path="/view-page" element={<Viewpage/>} />

        <Route path="/add-catagory" element={<Addcatagory/>} />

        <Route path="/view-catagories" element={<Viewcat/>} />
        <Route path="/add-table" element={<Addtable/>} />
        <Route path="/view-table" element={<Viewtable/>} />
    </Routes>
    </BrowserRouter>
  );
}

export default App;
